package comp533.joiner;

import gradingTools.comp533s19.assignment0.AMapReduceTracer;
import util.trace.Tracer;

public class TokenCounterJoiner extends AMapReduceTracer implements Joiner {
    private int joinerCount;
    private int finishedCtr;
    private int aNumThreads;

    public TokenCounterJoiner(final int aNumThreads) {
        this.joinerCount = aNumThreads;
        this.finishedCtr = 0;
        this.traceJoinerCreated(this, aNumThreads);
        this.aNumThreads = aNumThreads;
    }

    public int getNumThreads() {
    	return this.aNumThreads;
    }

    public void finished() {
    	this.traceJoinerFinishedTask(this, this.joinerCount, this.finishedCtr);
        this.finishedCtr += 1;
    }

    public synchronized void join() {
        if (this.finishedCtr == this.joinerCount) {
		    this.synchronizedNotify();
		    this.finishedCtr = 0;
		    //System.out.println("$$$$$");
		} else {
		    this.traceJoinerWaitStart(this, aNumThreads, finishedCtr);
		    try {
				this.wait();
			} catch (InterruptedException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
		    this.traceJoinerWaitEnd(this, aNumThreads, finishedCtr);
		    //System.out.println("$$$$$!!!");
		}

    }

    @Override
    public String toString() {
        return AMapReduceTracer.JOINER;
    }
}

